export const generateRandomEmail = () => {
    // Generate a readable prefix with a random number
    const prefix = 'user';
    const randomNumber = Math.floor(Math.random() * 100000); // Random 5-digit number

    // Combine for better readability while ensuring uniqueness
    return `${prefix}${randomNumber}@tempmail.com`;
  };
